  },
  login: async (parent, { username, password }) => {
    let res;
    await User.findOne({ username: username }).then(
      async (user) => {
        const match = await bcrypt.compare(password, user.password);
        console.log(match);
        console.log(user.password)
        if (match) {
          res = new AuthPayload(
            jwt.sign({ "http://localhost:4200/": { user } }, "TODO", {
              algorithm: "HS256",
